import React, { Component } from 'react';
import white_logo from '../img/WhiteLogo.png';

class Concepts extends Component {
  render() {
    return (
      <div className="side">
        <img src={white_logo} alt="Logo" className="side-logo" />
      </div>
    );
  }
}

export default Concepts;
